import React from "react";
import { Row, Col, Form, Stack} from "react-bootstrap";

const DateTime = () => {
  return (
    <Row>
      <Col sm={5} md={8} lg={3}>
        <Form>
<Stack direction="horizontal">
          <Form.Group>
            <Form.Control size="lg" type="date" />
          </Form.Group>
          </Stack>
          <Stack direction="horizontal">
          <Form.Group>
            <Form.Control size="lg" type="time" />
          </Form.Group>
          </Stack>
        </Form>
      </Col>
    </Row>
  );
};

export default DateTime;
